(15, 1626575266, 1626480000, 'Ministro Lima: Se debe investigar si 40.000 balas antitumulto se usaron en Senkata y Huayllani', 'Ivan Lima, ministro de justicia y transparencia institucional,  dvirtió este sábado que la investigación del ingreso irregular de municiones y tropas de Argentina debe esclarecer el destino y uso de por lo menos 40.000 balas antitumulto que según indagaciones iniciales fueron adjudicadas a las Fuerzas Armadas.', 'http://www.boliviatv.bo/principal/noticia.php?noticia=4978c3b3b6bb3b1a7412ec917be050a3&lang=es&fbclid=IwAR3l7ynXn4wXQ_MrXOND8L2xwFbl4CcYjo1QmTnYJa6LLi', 32, 2, 9),
(16, 1626579336, 1626480000, 'MAS tendrá congreso orgánico el 4 de agosto en Cochabamba', 'El Movimiento al Socialismo (MAS-IPSP) dio a conocer este sábado que habrá un congreso orgánico el cual se  realizará el 4 de agosto en Cochabamba. Expresando que la parte ideológica no habrá debate porque el MAS ', 'https://www.opinion.com.bo/articulo/pais/mas-tendra-congreso-organico-4-agosto-cochabamba/20210717131646827644.html', 13, 2, 39),
(17, 1626583318, 1626480000, 'Imputan formalmente a exgobernador Félix Patzi por provocar accidente de tránsito', 'El exgobernador del Departamento de La Paz, Felix Patzi, fue imputado por el delito de Homicidio y Lesiones Graves y Gravísimas en Accidente de Tránsito, el documento indica que Patzi tenía 1.50% en la prueba de alcoholemia, el automóvil del imputado da a entender que la parte posterior media del auto choca con otro automóvil, dejando así tres personas heridas. ', 'https://www.opinion.com.bo/articulo/pais/imputan-felix-patzi-provo/20210717185144827660.html', 13, 2, 39),
