(26, 1626744743, 1626652800, 'CC presenta anteproyecto para acabar con interinatos y el MAS lo califica de “panfleto”', 'La propuesta apunta a acabar con las designaciones de interinos en las entidades del Estado. De acuerdo con el propio recuento que realizó esta fuerza política, en el país existen 13 autoridades o ejecutivos designados de forma directa por el Presidente', 'https://eldeber.com.bo/pais/cc-presenta-anteproyecto-para-acabar-con-interinatos-y-el-mas-lo-califica-de-panfleto_239767?utm_medium=Social&utm_source=', 17, 2, 16),
(27, 1626745046, 1626652800, 'Cívicos, comunarios y transportistas cumplen cuatro días de bloqueo exigiendo que se designe al presidente de la Empresa Siderúrgica Mutún', 'Cívicos, comunarios y transportistas de Puerto Suárez cumplieron este lunes cuatro días de bloqueo en el ingreso principal al yacimiento de hierro Mutún. Los manifestantes piden que el Gobierno nacional nombre un nuevo presidente para la Empresa Siderúrgica Mutún (ESM).', 'https://eldeber.com.bo/economia/civicos-comunarios-y-transportistas-cumplen-cuatro-dias-de-bloqueo-exigiendo-que-se-designe-al-presi_239733?utm_medium', 17, 2, 16),
(28, 1626745339, 1626652800, 'Alcalde cruceño dice que aguarda que el Concejo apruebe la ley para el pago del bono escolar', 'El alcalde Jhonny Fernández compromete el pago del bono cuando se apruebe la ley y se cuente con la lista de estudiantes de los ciclos inicial y primaria. El concejal Manuel Saavedra propone mantener los recursos destinados para el desayuno escolar', 'https://eldeber.com.bo/santa-cruz/alcalde-cruceno-dice-que-aguarda-que-el-concejo-apruebe-la-ley-para-el-pago-del-bono-escolar_239701?utm_medium=Socia', 17, 2, 16),
(29, 1626745364, 1626393600, 'el censo debe realizarse el 2022', 'el vocero presidencial, jorge richter, ratifico que el censo de poblacion y vivienda se debe llevar el proximo año', 'https://www.reduno.com.bo/noticias/gobierno-ratifica-que-el-censo-se-debe-realizar-en-el-2022-202171619480?fbclid=IwAR0WW4bdHq1Rsytqm6X3TjsJX1ab-D5yOA', 24, 2, 41),
(30, 1626747285, 1626652800, 'Rector pide llevar a cabo el Censo 2022', 'El Rector de la UMSA demanda a las autoridades de gobierno que trabajen para que se lleve a cabo el CENSO 2022', '', 24, 1, 29),
(31, 1626748302, 1626652800, 'En Argentina se iniciaron dos procesos por el envío de armamento a Bolivia.', 'El embajador argentino en Bolivia, Ariel Basteiro, confirmó este lunes que en Argentina se abrieron dos procesos por el envío de armamento a Bolivia. “Para mí, es un dolor muy grande poder apreciar esto, confirmar lo que sabíamos a través de notas e informes sobre lallegada de material ilícito. Tengo que pedir disculpas al pueblo boliviano (por el envío de armas) en la presidencia de Macri”, dijo.', 'https://www.atb.com.bo/internacional/en-argentina-se-iniciaron-dos-procesos-por-el-envío-de-armamento-bolivia', 23, 2, 34),
(32, 1626748583, 1626652800, 'Evo Morales acusa a Mesa de justificar ingreso de armamento ilegal de Argentina a Bolivia.', 'El presidente del Movimiento al Socialismo dijo “Carlos Mesa, el historiador golpista, miente y justifica el ingreso de armamento ilegal de Argentina que fue usado para reprimir al pueblo en el golpe que él mismo promovió. Cada día se desenmascara y demuestra su complicidad con las masacres y corrupción del gobierno de facto”, publicó en su cuenta en la red social digital Twitter. Por lo tanto la respuesta del historiador no se dejo esperar “El único material realmente bélico que llegó en ese material de apoyo de la Argentina era para funcionarios de Argentina”, aseveró Mesa.', 'https://www.atb.com.bo/seguridad/evo-morales-acusa-mesa-de-justificar-ingreso-de-armamento-ilegal-de-argentina-bolivia', 23, 2, 34),
(33, 1626748791, 1626652800, 'Juicio oral por “Mochilas I” y “Comidas” está previsto para hoy', 'La audiencia de inicio se presentará el 19 de julio a las nueve de la mañana por vía virtual, en ello se tomará los casos del exalcalde Jose Maria Leyes, que acumulo desde el 2018 diversos procesos por los supuestos delitos de corrupción como el caso “Mochilas I” y el caso “Comidas”, pero el juicio de los casos “Cámaras”, se postergó para el 27 de septiembre de este año debido a que el exsecretario municipal Administrativo y Financiero Diego Moreno Barrón, por el motivo que está prófugo. ', 'https://www.opinion.com.bo/articulo/cochabamba/juicio-oral-mochilas-i-comidas-previsto-hoy/20210718202205827774.html', 13, 2, 39),
(34, 1626749040, 1626652800, 'presentaron armamentos antidisturbios argentinos. ', 'Durante los conflictos de noviembre del 2019, ingresan al pais dos tipo de materiales de materiales antidisturbios de manera irregular, 27mil cartuchos de perdigón de gomas, los presuntos involucrados son Yuri Calderón ex comandante de la policía boliviana, Jorge Terceros ex comandante de la FF.AA y el ex embajador  de Argentina en Bolivia.', 'https://www.redbolivision.tv.bo/video/noticieros-al-dia-programa-del-19-de-julio-del-2021/', 22, 2, 31),
(35, 1626749296, 1626652800, '6 informes internacionales denuncian a Áñez por masacres, torturas y ejecuciones extrajudiciales.', 'Cinco organizaciones internacionales y una entidad nacional denuncian que en el régimen de Jeanine Añez se produjeron masacres, asesinatos, ejecuciones extrajudiciales, torturas, uso desproporcionado e innecesario de la fuerza contra manifestantes desarmados y se detectó la presencia de grupos violentos paraestatales.  Los informes fueron elaborados, en distintos momentos, por la Comisión Interamericana de Derechos Humanos (CIDH), la Clínica de Derechos Humanos de Harvard, Amnistía Internacional, el Alto Comisionado de las Naciones Unidas para los Derechos Humanos (ACNUDH), el Instituto de Terapia e Investigación Sobre las Secuelas de la Tortura y la Violencia de Estado (ITEI) y la Defensoría del Pueblo.', 'https://www.atb.com.bo/política/6-informes-internacionales-denuncian-áñez-por-masacres-torturas-y-ejecuciones-extrajudiciales', 23, 2, 34),
(36, 1626749434, 1626652800, 'Mesa ve una “tramoya vergonzosa” en los casos del supuesto material antidisturbios', 'Como una «tramoya vergonzosa» calificó este lunes el expresidente del Estado, Carlos Mesa a la versión del supuesto envío de material antidisturbios desde Ecuador y Argentina como base del caso del presunto «golpe de Estado». Observó que el Gobierno tiene la dificultad de «hacer cuadrar» las fechas en el caso del material argentino, por lo que se visibilizan contradicciones.', 'https://lapatria.bo/2021/07/19/mesa-ve-una-tramoya-vergonzosa-en-los-casos-del-supuesto-material-antidisturbios/', 15, 2, 17),
(37, 1626750009, 1626652800, 'INRA: En la gestión de facto se generó normativa agraria para favorecer a un grupo privilegiado.', 'El director de planificación del Instituto Nacional de Reforma Agraria (INRA), Juan de Dios Fernández, reveló este lunes que durante la gestión de facto de Jeanine Áñez, se elaboró normativa agraria para favorecer a un grupo privilegiado, principalmente en el departamento de Santa Cruz.  “En el año del golpe de Estado hay una distorsión de la institucionalidad agraria y se ha generado incluso normativa para favorecer la revisión de procesos que tenían irregularidades en el saneamiento de tierras”, manifestó en contacto con radio Patria Nueva.', 'https://www.atb.com.bo/sociedad/inra-en-la-gestión-de-facto-se-generó-normativa-agraria-para-favorecer-un-grupo-privilegiado', 23, 2, 34),
(38, 1626750455, 1626652800, 'Socialización del proyecto carbonato de litio', 'El asambleísta Edwin Fuentes Camacho socializaso el proyecto en Coipasa con autoridades departamentales y nacionales dando así un fruto a futuro', '', 39, 2, 30),
(39, 1626751991, 1626566400, 'Gabriela Mendoza, La ministra de planificación de desarrollo, informo que el gobierno nacional revierte la paralización de obras en el departamento de la Paz.', 'La ministra de Planificación del Desarrollo, dijo que el gobierno nocional revirtió la paralización de obras en el departamento de la Paz con una inversión pública de 5.509 millones del PGE, una cifra superior a los 2.511 millones ejecutados en el régimen de Jeanine Añez.', 'http://www.boliviatv.bo/principal/noticia.php?noticia=6107cdbf4b36598a7e125b5bf78ddceb&lang=es', 32, 2, 9),
(40, 1626751997, 1626652800, 'Alcaldía posesiona a Roberto Kotori como nuevo Intendente Municipal', 'Roberto Kotori, quien anteriormente era gerente del Programa de Mantenimiento (PROMAN), se hace cargo de la Intendencia por medio del escándalo por motivo de renuncia y destitución de Vargas la causa porque denunció las diversas presiones para devolver objetos que fue decomisado de los locales nocturnos, pero por otra parte la Alcaldía hizo una denuncia por supuesto apropiamiento de los objetos decomisados. ', 'https://www.opinion.com.bo/articulo/cochabamba/reyes-villa-presenta-roberto-kotori-como-nuevo-intendente-municipal/20210719091326827809.html', 13, 2, 39),
(41, 1626752259, 1626652800, 'En el departamento de potosí 35 maestros urbanos fueron citados a declarar por la Fuerza Especial de Lucha contra el Crimen.', 'En el departamento de potosí 35 maestros urbanos fueron citados a declarar hoy 19 de julio por la Fuerza Especial de Lucha contra el Crimen,para declarar sobre los hechos suscitados el año 2019, cuando la población potosina se movilizó en defensa del Litio Potosino y a esto se sumó las protestas por el Fraude Electoral. Fernando Isla, maestro citado por la FELCC, sostuvo que fueron amenazados, que si no se presentaban a declarar iban a presentar orden de aprehensión en contra de los acusados, afirmó que son víctimas de una persecución política y amedrentamiento por parte del Gobierno. ', '', 35, 2, 18),
(42, 1626752659, 1626652800, 'El Ministro de Gobierno Eduardo del Castillo hoy en la mañana 19 de julio, presentó las municiones enviadas desde el país de la Argentina y Ecuador el año 2019', 'El Ministro de Gobierno Eduardo del Castillo hoy en la mañana 19 de julio, presentó las municiones enviadas desde el país de la Argentina y Ecuador el año 2019, material antidisturbio que fue hallado en los depósitos de la Policía Boliviana,  según el Comandante General de la Policia Jhonny Aguilera informó que según el ordenamiento jurídico estas irregularidades están tipificadas como delitos de Trafico Ilicitos de Armas, y que está penado con 30 años de cárcel sin derecho a indulto, y apuntó al Ex-Comandante de la POlicia Yuri Calderon, el Ex-Comandante General de la Fuerza Aérea Boliviana Gonzalo Terceros y al ex embajador de la argentina en Bolivia.', '', 35, 2, 18),
(43, 1626752769, 1626652800, 'Carlos Mesa calificó como una vergonzosa tramoña inventada y falsa sobre el supuesto “Golpe de Estado”', 'El ExPresidente y Ex Candidato Presidencial Carlos Mesa calificó como una vergonzosa tramoña inventada y falsa sobre el supuesto “Golpe de Estado” , la versión que maneja el Gobierno sobre el ingreso de municiones anti disturbios desde la Argentina, al país el año 2019, pretende hacer creer a los Bolivianos, al país de la Argentina, e incluso al Ecuador, explicó que el único material que llegó desde la Argentina era para funcionarios de Embajada Argentina .', '', 35, 2, 18),
(44, 1626752793, 1626652800, 'Ministerio de Justicia y Cooperación Alemana trabajarán de manera conjunta contra la violencia hacia las mujeres', 'Tanto el gobierno de la Republica Federal de Alemania cómo el Estado Plurinacional de Bolivia, acordaron consolidar acciones en previsión primara en el marco de la lucha contra la violencia hacia las mujeres desde un ámbito educativo y partir de los medios de comunicación. Todas las acciones de la cooperación alemana están enmarcadas en las prioridades del Estado Plurinacional de Bolivia.', 'http://www.boliviatv.bo/principal/noticia.php?noticia=c6c7a174d9666eaeabc999f56f6de555&lang=es', 32, 2, 9),
(45, 1626753220, 1626652800, 'el concejal del movimiento al socialismo Oscar Sandi, quien denuncia una elección ilegal en la directiva del consejo municipal del departamento de Sucre', 'Dos vocales de la sala constitucional emitieron criterios diferentes respecto a la acción planteada, por el concejal del movimiento al socialismo Oscar Sandi, quien denuncia una elección ilegal en la directiva del consejo municipal del departamento de Sucre vulnerando sus derechos. Un tercer vocal fue convocado para dirimir este caso, el vicepresidente de consejo municipal Antonio Pino a tiempo de erradicar la legalidad de la actual elección directiva dijo que espera que el vocal a cargo obre conforme a lo que la norma establece.', '', 35, 1, 18),
(46, 1626753395, 1626652800, 'Segunda audiencia de juicio oral disciplinario por el caso ', 'Segunda audiencia de juicio oral disciplinario por el caso ', 'ttps://www.facebook.com/radiofidescb/videos/337083111299518/?sfnsn=mo ', 35, 2, 18),
(47, 1626753540, 1626652800, 'La audiencia del ex Alcalde Jose Maria Leyes fue suspendida para el mes de Noviembre.', 'La audiencia del ex Alcalde Jose Maria Leyes fue suspendida para el mes de Noviembre. Señalaba el responsable de la unidad jurídica de la Alcaldía de Cochabamba Grover Arias por la ausencia del señor Diego Bernando Moreno quien estuvo ausente en todos los procesos en su contra y que esto generó la declaratoria de rebeldía correspondiente a mandamiento de aprehensión y está bajo persecución. ', '', 35, 2, 18),
(48, 1626753637, 1626652800, 'El municipio de Santa Cruz exigen el bono escolar de 350 bs que prometió el Alcalde Jonny', 'El municipio de Santa Cruz exigen el bono escolar de 350 bs que prometió el Alcalde Jonny en su campaña política por la Alcaldía del Departamento de Santa Cruz, el concejal Manuel Saavedra informó que el municipio está en condiciones de dotar el desayuno escolar y el bono escolar, sostuvo que Jhonny tiene que cumplir lo que prometió y que por su parte no hay voluntad política y que no está pensando en la gente.', '', 35, 2, 18),
(49, 1626753816, 1626652800, 'Suspenden audiencia del caso Mochilas I ', 'El secretario de Asuntos Jurídicos de la Alcaldía de Cochabamba, Orlando Vargas, dio a conocer que el dia de hoy la suspensión de la audiencia por el caso de “Mochilas I”, que es un proceso contra el exalcalde José María Leyes, a causa de la inasistencia de Diego Moreno que es uno de los “Co-procesados”, quien fue declarado como rebelde. En ese caso se dio una nueva fecha del juicio que es el 16 de noviembre, dado el hecho el juicio debería ser virtual pero el Ministerio Publico indico que debe ser presencial. ', 'https://www.opinion.com.bo/articulo/cochabamba/suspenden-audiencia-mochilas-i-inasistencia-diego-moreno/20210719160721827835.html', 13, 2, 39),
(50, 1626754278, 1626652800, 'Ministro de Medio Ambiente posesiona a Óscar Zelada como nuevo presidente de la empresa Misicuni', 'El nuevo director fue posesionado mediante una Resolución Suprema de Nº27571 decretada hoy por el presidente del Estado, Luis Arce. El Ministro de Medio Ambiente y Agua, Juan Santos, acompañado del Viceministro de Agua Potable y Saneamiento Básico, Carmelo Valda, posesionó al ingeniero Óscar Zelada como nuevo presidente del directorio de la empresa Misicuni.', 'https://www.opinion.com.bo/articulo/cochabamba/ministro-medio-ambiente-posesiona-oscar-zelada-como-nuevo-presidente-empresa-misicuni/20210719213833827', 13, 2, 39),
(51, 1626755702, 1626652800, 'La licencia de Patzi fue suspendida definitivamente; no podrá volver a conducir un auto en Bolivia', 'Este fin de semana, se determinó la detención domiciliaria a Patzi, además el arraigo y la obligación de ser presente en la Fiscalía cada 15 dias, debido al hecho en su segundo accidente de tránsito por conducir en un estado etílico con un examen de alcoholemia de 1,50%, dejando a tres personas heridas, por ello la licencia de Felix Patzi, que fue gobernador de La Paz, queda suspendida definitivamente, es decir, que nunca más volverá a conducir un automóvil en Bolivia.', 'https://www.opinion.com.bo/articulo/pais/licencia-patzi-fue-suspendida-definitivamente-podra-volver-conducir-auto-bolivia/20210719192634827850.html', 13, 2, 39),
(52, 1626756772, 1626652800, 'Pedro Castillo llama \"a la más amplia unidad del pueblo peruano\"', 'El presidente electo de Perú, Pedro Castillo, el profesor de una escuela rural y sindicalista dijo que tras ganar el dia 6 de junio con quien disputó el cargo Keiko Fujimori, Pedro Castillo asumirá  el mando el mismo día en que Peru estara celebrando su bicentenario de su independencia, por ello llamó “a la unidad del pueblo peruano”, en ese caso ejercerá la gestión a partir de este 28 de julio. ', 'https://www.opinion.com.bo/articulo/mundo/pedro-castillo-llama-mas-amplia-unidad-pueblo-peruano/20210719220009827871.html', 13, 2, 39),
(53, 1626757485, 1626652800, 'Keiko Fujimori anuncia que reconocerá los resultados de elecciones peruanas', 'Keiko Fujimori recalcó que si aceptaría la proclamación de Castillo, pero que en su opinión, es “Ilegítimo” porque nos indica que el partido político, Peru Libre de Castillo habría robado miles de votos el dia de las elecciones, según el recuento oficial Castillo ganó por poco más de 44.000 de votos de diferencia. ', 'https://www.opinion.com.bo/articulo/mundo/keiko-fujimori-anuncia-que-reconocera-resultados-elecciones-peruanas/20210719192924827852.html', 13, 2, 39),
(54, 1626784201, 1626480000, 'caso armamento de argentina a bolivia en el año 2019', 'Mauricio Macri expresidente de argentina es acusado por envíar armamento a Bolivia en el año 2019 e involucra a sus ex ministros, esta maniobra habría contado con la participación de la exministra de Seguridad, Patricia Bullrich; el exministro de Defensa, Oscar Aguad; el exministro de Relaciones Exteriores y Culto, Jorge Faurie; el exembajador de Argentina en Bolivia, Normando Álvarez García; el exdirector general de Aduanas, Jorge Dávila, y el exdirector ejecutivo de la Agencia Nacional de Materiales Controlados, Eugenio Cozzi. - violación al código penal en el artículo 219 y 220', '', 47, 2, 22),
