(63, 1626833133, 1626739200, 'Andrónico: Sesión de honor del 6 de Agosto será en el nuevo edificio legislativo de La Paz', 'La sesión de Honor de la Asamblea Legislativa Plurinacional por el 196 aniversario de nuestro país, será desarrollado en el nuevo edificio legialativo en la ciudad de La Paz. Autoridades de Sucre dijeron que debería respetarse la capital, ya que Sucre es donde nació Bolivia y  además de ser sede de los actos centrales ', 'https://correodelsur.com/local/20210720_andronico-sesion-de-honor-del-6-de-agosto-sera-en-el-nuevo-edificio-legislativo-de-la-paz.html Leído en Periód', 11, 2, 47),
