(69, 1626839131, 1626739200, 'La ex presidenta jeanine añez pide audiencia a Bachelet y exige que la ONU este presente en su audiencia', 'La mandataria pide una audiencia en la que señala podrá demostrar con documentos por qué debe ser liberada. Acusa al Gobierno de Luis Arce de persecución y de \"quebrantar al órgano judicial\",La misiva está dirigida a la expresidenta de Chile, Michelle Bachelet, quien ahora ejerce como la Alta Comisionada de las Naciones unidas para los Derechos Humanos', 'https://unitel.bo/politica/jeanine-anez-pide-audiencia-a-la-alta-comisionada-de-la-onu-de-derechos-humanos_154618', 21, 2, 32),
