(71, 1626840016, 1626739200, ' Bancada de CC en Diputados descarta brindar descargos ante Comisión de Ética por viaje a EEUU', 'La bancada de la alianza Comunidad Ciudadana (CC) en la Cámara de Diputados descartó brindar los descargos correspondientes, ante la Comisión de Ética, por el viaje que hicieron junto a un grupo de legisladores de Creemos a Estados Unidos para denunciar ante organismos internacionales la presunta vulneración de derechos humanos en Bolivia.', 'https://correodelsur.com/local/20210720_andronico-sesion-de-honor-del-6-de-agosto-sera-en-el-nuevo-edificio-legislativo-de-la-paz.html Leído en Periód', 11, 2, 47),
