(73, 1626840985, 1626739200, 'Unión Europea reafirma trabajo conjunto con América Latina', 'El Alto Representante de la Unión Europea para Asuntos Exteriores y Política de Seguridad reiteró el compromiso firme de la Unión Europea en sus relaciones con América Latina y el Caribe y con la Comunidad Andina. La determinación de la Unión Europea es fortalecer la democracia, pero sobre todo intensificar los esfuerzos conjuntos para superar los problemas provocados por la pandemia; coadyubar en los problemas económicos, sanitarios y sociales producto de la pandemia ', 'http://www.boliviatv.bo/principal/noticia.php?noticia=9a2d10324f7805b2b98ab99771f375b5&lang=es ', 32, 2, 9),
(74, 1626872311, 1626739200, 'Un grupo de personas protesta contra los procesos disciplinarios en la Policía', 'El grupo de personas que llegó a las puertas del edificio de exidentificaciones de la Policía protestaron contra el proceso que dio inicio contra ocho uniformados durante el motín del año 2019, los cuales los fiscales determinaron su baja definitiva gracias a que son acusados de hacer política dentro de una institución policial y también por la quema de símbolos patrios en el supuesto motín del año 2019.', 'https://www.opinion.com.bo/articulo/cochabamba/grupo-personas-protesta-procesos-disciplinarios-policia/20210720114343827945.html', 13, 2, 39),
(75, 1626873354, 1626739200, 'Registro catastral: Proponen eliminar “burocracia” en trámites y entregar documentación en 24 horas', 'El director de Catastro de la Alcaldía de Cochabamba, Hugo Peña, dijo que está trabajando en una propuesta para así eliminar la burocracia en la entrega de registros y así que se logre alcanzar el periodo de trámite durante 24 horas o aún menos, en la propuesta incluye que las autorizaciones serán por código QR y que ya no será necesario varias firmas sino solamente una firma, donde se podrá registrar el inmueble con una cuenta de información legal y técnica, por ello Peña dijo que en su gestión los trámites de catastro de agilizaron.', 'https://www.opinion.com.bo/articulo/cochabamba/director-catastro-propone-eliminar-burocracia-tramites-entregar-registros-24-horas/20210720220344828027', 13, 2, 39),
(76, 1626874342, 1626739200, 'Kotoriy continuará mesas de trabajo que inició exintendente con negocios nocturnos', 'El ordenamiento de los mercados es una parte de las tareas las cuales la Intendencia se hace cargo, por ello el nuevo intendente municipal Roberto Kotoriy dijo que ya comenzaron reuniones con el sector de mercados y que se continuará con las mesas de trabajo que el exintendente Fernando Vargas estaba trabajando en los negocios nocturnos.', 'https://www.opinion.com.bo/articulo/cochabamba/kotoriy-continuara-mesas-trabajo-que-inicio-exintendente-negocios-nocturnos/20210720220658828030.html', 13, 2, 39),
(77, 1626874838, 1626739200, 'Patty a un periódico argentino: ‘dicen que soy el terror de los antipatria’', 'En su entrevista, Patty vinculó al presidente de Brasil, Jair Bolsonaro, en los sucesos de 2019.También Patty involucró a Luis Fernando Camacho en este aspecto y afirmó que si se “trabaja en serio” en las indagaciones sobre el gobernador cruceño es posible que salga a la luz el supuesto “apoyo dado por Brasil” en el “golpe”.', 'https://www.opinion.com.bo/articulo/pais/patty-periodico-argentino-dicen-que-soy-terror-antipatria/20210720195248828003.html', 13, 2, 39),
(78, 1626876211, 1626739200, 'Médicos se declaran en emergencia y emplazan al Gobierno por artículos polémicos en la Ley de Emergencia Sanitaria', 'Los profesionales en salud se declararon en emergencia este lunes y solicitaron una reunión con el presidente Luis Arce Catacora para pedirle que se derogue la Ley de Emergencia Sanitaria, tras conocer que entre su reglamentación “no solo se vulneran los derechos de los médicos, sino de la población en general”.', 'https://eldeber.com.bo/santa-cruz/medicos-se-declaran-en-emergencia-y-emplazan-al-gobierno-por-articulos-polemicos-en-la-ley-de-emerge_239766', 17, 2, 16),
(79, 1626876468, 1626739200, 'Trabajadores de salud entran en paro este miércoles y piden a los tres niveles de gobierno atender sus pedidos', 'Los trabajadores de la salud confirmaron que mañana acatarán un paro de salud de 24 horas en todo el departamento cruceño para exigir se cumpla su pliego petitorio que incluye al menos ocho puntos, entre la anulación de la Ley de Emergencia Sanitaria, el respeto a sus seis horas de trabajo, el pago del bono de viático y la reposición de ítems.', 'https://eldeber.com.bo/santa-cruz/trabajadores-de-salud-entran-en-paro-este-miercoles-y-piden-a-los-tres-niveles-de-gobierno-atender-s_239962', 17, 2, 16),
