(84, 1626911856, 1626739200, 'Expresidenta Áñez recurre a la Alta Comisionada Bachelet para que intervenga en su caso', 'La Ex Presidenta Jeanine Áñez, pidió este martes a la Alta Comisionada de la Naciones Unidas para los Derechos Humanos, Michelle Bachelet, intervenir en su caso en relación a la detención que guarda en la cárcel por lo que considera una “presión política”  En la carta enviada Bachelet la ex mandataria pide una audiencia mediante su hija, Carolina Rivera, para exponer su caso, denuncia que su reclusión es injusta, ya que la acusan de una autoproclamación a la Presidencia Boliviana y como la autora del “Golpe de Estado”. En la misiva, la ex presidenta asegura haber cumplido con su deber constitucional como segunda vicepresidenta de la Cámara de Senadores, ante el vacío de poder que existía tras las elecciones fallidas de octubre y renuncia de Evo Morales en noviembre de 2019.', 'https://www.facebook.com/400816867085296/posts/1221925148307793/?sfnsn=mo', 35, 2, 18),
