(88, 1626914972, 1626739200, 'Autoridades de los Ayllus de San Lucas recibirán sus credenciales para el consejo municipal', 'Las primeras autoridades indígenas electas en Chuquisaca recibirán sus credenciales para el consejo municipal de San Lucas.', 'https://www.facebook.com/TvSucreUSFX/videos/257624012422173', 20, 2, 54),
(89, 1626915790, 1626739200, 'Conade Cochabamba retoma movilizaciones desde el 6 de agosto y el MAS rechaza advertencias', 'El Comité Nacional de Defensa de la Democracia (Conade) de Cochabamba informó este martes que existe coordinación con plataformas cívicas del país, militares y policías pasivos para retomar movilizaciones a partir del próximo 6 de agosto en rechazo a los procesos contra ex autoridades. Lizeth Beramendi, miembro del Conade sostuvo que las medidas de protesta serán escalonadas en demanda de la libertad de los denominados “presos políticos” y la suspensión de procesos contra efectivos policiales. Ante estas aseveraciones, autoridades del Movimiento Al Socialismo (MAS), lamentan que organizaciones “busquen confrontación entre bolivianos”, la concejal de este partido, Silvia Soliz, aseveró que el oficialismo no responderá a estas advertencias y pidió no repetir las acciones del 2019.', 'https://www.facebook.com/400816867085296/posts/1221937741639867/?sfnsn=mo ', 35, 2, 18),
(90, 1626916039, 1626825600, 'Sala Constitucional declara incompetencia con respecto a la elección de la directiva del consejo municipal', 'El tribunal de garantías ha constatado la vulneración del derecho al ejercicio de la función pública, la sala constitucional determino incompetencia en el caso de la elección de la directiva del consejo municipal haciendo énfasis de que en virtud al municipalismo, solo el consejo municipal puede dotarse de directiva', 'https://www.facebook.com/TvSucreUSFX/videos/142549941327102', 20, 2, 54),
(91, 1626916474, 1626825600, 'El TED socializa normativas sobre derechos de la mujer acoso y violencia', 'Se realizo el diálogo sobre los derechos de las mujeres, acoso y violencia política dirigido a asambleístas departamentales. El órgano electoral bajo sus competencias socializó la normativa con respecto al tema.', 'https://www.facebook.com/TvSucreUSFX/videos/142549941327102', 20, 1, 54),
(92, 1626916768, 1626739200, 'Revocan detención domiciliaria de Kaliman y emiten orden de aprehensión en su contra', 'La justicia determinó este martes revocar la detención domiciliaria y emitir orden de aprehensión en contra del excomandante de las Fuerzas Armadas (FF. AA), Williams Kaliman Romero, por el delito de Incumplimiento de Deberes en un proceso interpuesto por el abogado Omar Durán, vinculado a no haber movilizado a tiempo a los efectivos militares para frenar la convulsión social del 2019. El denunciante, Omar Durán, informó que en audiencia virtual la jueza del caso declaró en rebeldía al exjefe castrense y ordenó la ejecución de los Bs 50.000 que depositó como fianza para su búsqueda. Según explicó el jurista, a la audiencia solo se presentó la abogada de Kaliman “sin ningún poder para hablar”, por lo que la justicia determinó ejecutar la orden de aprehensión, se determinó la anotación de los bienes del excomandante de las FFAA quien es buscado por la policía y fiscalía boliviana por el caso del supuesto “golpe de Estado” y por un segundo proceso.', 'https://www.facebook.com/400816867085296/posts/1221921184974856/?sfnsn=mo ', 35, 2, 18),
(93, 1626916900, 1626825600, 'Comité Cívico lanzó una convocatoria a las instituciones para asamblea', 'El Comité Cívico lanzo una convocatoria a las intituciones con el fin de hacer respetar los derechos del Departamento de Chuquisaca, el comité se manifiesta ante la noticia de que la sesión de honor del 6 de agosto no se llevará a cabo en Sucre, exigen que se cumpla la ley ', 'https://www.facebook.com/TvSucreUSFX/videos/142549941327102', 20, 2, 54),
(94, 1626917120, 1626739200, 'Comcipo no descarta medidas de presión contra la “persecución política”', 'El Comité Cívico Potosinista (Comcipo), convocó a todas sus instituciones afiliadas a un consejo consultivo presencial para esta noche donde se determinará si se asumirán medidas de presión contra la “persecución política” activada según consideran, desde instancias judiciales contra dirigentes cívicos y de otros sectores citados para comparecer por los hechos de 2019. “Ya ha empezado la persecución, tenemos que respetar la lucha del pueblo boliviano, del pueblo potosino. Nada está descartado, los delegados van a hacer escuchar su voz indicando claramente qué es lo que debemos hacer para poner un alto a esta situación”, sostuvo Juan Carlos Manuel, representante de Comcipo.', 'https://www.facebook.com/400816867085296/posts/1221941294972845/?sfnsn=mo ', 35, 2, 18),
(95, 1626917240, 1626739200, 'Defensa de policías enjuiciados anuncia procesos contra la Fiscalía Policial', 'El abogado de 3 funcionarios policiales procesados por el presunto “motín policial” presentará una denuncia contra la fiscalía policial y el tribunal discipilario por incumpliento de deberes, y que el Capitan Gabriel Vargas haciendo uso de su derecho constitucional a expresarse públicamente es observado por haber vertido declaraciones a los medios de comunicación .', '', 35, 2, 18),
(96, 1626917591, 1626739200, 'Comunidad Ciudadana afirma de UCCS quiere dilatar las sesiones para el Pago de Bono Escolar', 'Para Comunidad Ciudadana llama la atención que UCSS y el alcalde Jhonny Fernandez sigan postergando el tema del análisis del desayuno escolar y el bono estudiantil prometido en campaña.   Según el concejal Juan Carlos Terano no hay interés para pagar el bono estudiantil, y que es la segunda vez que suspenden la sesión de constitución. ', '', 35, 2, 18),
