(99, 1626917740, 1626825600, 'Gobierno aprueba Decreto Supremo que declara prioridad el Censo de Población para el 2022', 'El presidente Luis Arce informó que el gabinete de ministros aprobó este miércoles el Decreto Supremo que declara prioridad nacional el Censo de Población y Vivienda para 2022.', 'https://www.reduno.com.bo/noticias/gobierno-aprueba-decreto-supremo-que-declara-prioridad-el-censo-de-poblacion-para-el-2022-2021721112921', 24, 1, 29),
(100, 1626917907, 1626739200, 'Los familiares de los policías citados por el caso motín policial piden justicia', 'Piden a la Fiscalía y al Tribunal Policial actuar de manera parcializada ante los procesos que se sigan contra sus familiares lamentan que las pericias realizadas no hayan sido tomadas en cuenta por el Tribunal Disciplinario y que se trataría de una persecución política hacia los uniformados. ', '', 35, 2, 18),
(101, 1626918192, 1626739200, 'Los campesinos de la federación de trabajadores de Santa Cruz piden que el Diputado Rolando Cuellar se dedique a trabajar', 'Los campesinos de la federación de trabajadores de Santa Cruz piden que el Diputado Rolando Cuellar se dedique a trabajar desde el parlamento nacional por el país y dejar de interferir en la institución intentando un paralelismo dirigencial. Según el dirigente Marco Miranda, no permitirán más intentos de dividir la dirigencia campesina. ', '', 35, 2, 18),
(102, 1626918417, 1626825600, 'El viceministro de régimen interior y policial Nelson Cox habla de la aprehensión al líder de la Resistencia Juvenil', 'El viceministro de régimen interior y policial Nelson Cox habla de la aprehensión al líder de la Resistencia Juvenil Cochala Mario Bascope que se trasladó del departamento de Santa Cruz al departamento de Sucre, acusado por los daños ocasionados al patrimonio de esta ciudad en 6 de octubre del año 2020.', '', 35, 2, 18),
(103, 1626918497, 1626825600, 'Esposas de Policias en vigilia ', 'La esposas de los policías  están en el cuarto día de vigilia y aseguran que continuarán con las medidas, ya que muchos de los policías enjuiciados no están permitidos a dar declaraciones a los medios de comunicación. ', '', 35, 2, 18),
