(105, 1626918809, 1626825600, 'Mario Antonio \"Tonchy\" Bascope fue trasladado a Sucre', 'Nelson Cox, vice ministro indica que Mario Bascope miembro de la Resistencia Juvenil Cochala fue apresado y transladado al penal de Sucre', 'https://youtu.be/ZP8GSnwDtNA', 32, 2, 43),
(106, 1626919280, 1626825600, 'CENSO de población y vivienda será el 16 de noviembre de 2022', 'Gabriela Mendoza indica que el gobierno central realiza esfuerzos a partir del ministerios de planificación y desarrollo y del INE para revertir el descuido del gobierno de facto, el CENSO permitirá una fotografía clara de la realidad pública', 'http://www.boliviatv.bo/principal/tvenvivo71.php', 32, 1, 29),
(107, 1626919553, 1658361600, 'CENSO permitirá certidumbre para el país', 'El diputado Juan Angulo indica que es una señal del gobierno que va a llevarlo a cabo, dejando de lado lo que tergiversaba la oposición y dejando de lado la acción del gobierno de facto que no quería llevar a cabo el CENSO', 'http://www.boliviatv.bo/principal/tvenvivo71.php', 24, 1, 29),
(108, 1626919729, 1626825600, 'Ya existe fecha para el Censo de Población y Vivienda.', 'El Gobierno de Bolivia aprobó este miércoles mediante Decreto Supremo la realización del Censo de población y vivienda para el 16 de noviembre del próximo año.', 'https://twitter.com/Canal_BoliviaTV/status/1418022423488876546?s=19', 32, 1, 34),
(109, 1626920304, 1626825600, 'El alcalde La Paz propone crear una comisión para garantizar confiabilidad.', 'ARIAS PROPONE CREAR COMISIÓN PARA GARANTIZAR CONFIABILIDAD DEL CENSO  El alcalde de La Paz, Iván Arias, propuso este miércoles conformar una comisión para garantizar la confiabilidad del #Censo de Población y Vivienda, programado para el 16 noviembre de 2022.', 'https://www.facebook.com/452244424816992/posts/5993378000703579/', 23, 2, 34),
(110, 1626920449, 1626825600, 'El censo de población y vivienda se realizara el 16 de Noviembre de 2022.', 'El presidente Luis Arce informó que el gabinete de ministros aprobó este miércoles el Decreto Supremo que declara prioridad nacional el Censo de Población y Vivienda para 2022. “Hoy en Gabinete aprobamos el Decreto Supremo que declara prioridad nacional el Censo de Población y Vivienda 2022. Nuestro Gobierno, como comprometió, garantiza el financiamiento y respaldo institucional para realizar el Censo Nacional en noviembre 2022”, aseguró mediante una publicación en su cuenta en la red social Facebook.', 'https://www.facebook.com/452244424816992/posts/5991973010844078/', 23, 1, 34);
INSERT INTO `noticia` (`idnoticia`, `fecha_registro`, `fecha_noticia`, `titular`, `resumen`, `url_noticia`, `rel_idmedio`, `rel_idcuestionario`, `rel_idusuario`) VALUES
(111, 1626920792, 1626825600, 'Beneplácito por la realización del Censo por parte de la FEJUVE.', 'Fejuve aplaude la realización del censo en Bolivia ya que primeramente estaba programado para el 2024. El dirigente de la FEJUVE La Paz, Flavio Chacón, aplaudió la realización del censo a llevarse a cabo el 16 de Noviembre y establece que pedirán que tenga una pregunta sobre el internet, dijo Chacón  ', 'https://www.facebook.com/452244424816992/posts/5991877017520344/', 23, 2, 34),
(112, 1626921125, 1626825600, 'Fedjuve celebra sus 70 años con un desfile y genera críticas', 'En medio de la pandemia la Fedjuve realiza un desfile por los 70 años de su fundación causando incertidumbre en la población orureña', 'https://impresa.lapatria.bo/noticia/1040246/fedjuve-celebra-sus-70-anos-con-un-desfile-y-genera-criticas#articulo', 15, 2, 17),
(113, 1626921575, 1626825600, 'Oruro en pie de lucha desde el lunes ante indiferencia del Gobierno', 'El vicepresidente del Comité Cívico, German Delgado señaló que hasta la fecha no se tuvo respuesta enviando una nota de solicitud de atención para el desarrollo de Oruro conjuntamente con el tema en discusión de las regalías, ya que Oruro solo percibe el tres por ciento de la producción minera y la misma suerte correrá la explotación del litio.  ', 'https://lapatria.bo/2021/07/21/oruro-en-pie-de-lucha-desde-el-lunes-ante-indiferencia-del-gobierno/', 15, 2, 30),
(114, 1626924134, 1626825600, 'Aprenden a otro líder de la resistencia cochala ', '						Aprenden a Mario Bascope ex líder de la resistencia cochala por atentados a los vienes del estado, dio a conocer el viceministro  de regímen  interior y policías Nelson Cox.					', 'https://www.redbolivision.tv.bo/video/noticieros-al-dia-programa-del-21-de-julio-del-2021/', 22, 2, 31),
(115, 1626926029, 1626825600, 'Diputados adjudica sus muebles a importadores y promete otras licitaciones a productores', 'Entre junio y julio de este año, la Cámara de Diputados lanzó una decena de licitaciones para la compra de sillas, escritorios, teléfonos y un centro de datos por la suma de Bs 15,7 millones. Las licitaciones contenían exigencias que los microproductores no podían cumplir.  ', 'https://eldeber.com.bo/pais/diputados-adjudica-sus-muebles-a-importadores-y-promete-otras-licitaciones-a-productores_240077?utm_medium=Social&utm_sour', 17, 2, 16),
(116, 1626926264, 1626825600, 'Gobernación, Alcaldía y cívicos anuncian fiscalización del censo en 2022', 'De acuerdo al anuncio del Ministerio de Planificación del Desarrollo, el censo será financiado por el Banco Mundial y se prevé que los resultados finales se den a conocer en el plazo máximo de un año, después haberse recabado los datos', 'https://eldeber.com.bo/santa-cruz/gobernacion-alcaldia-y-civicos-anuncian-fiscalizacion-del-censo-en-2022_240058?utm_medium=Social&utm_source=Facebook', 17, 2, 16),
(117, 1626926382, 1626825600, 'El Censo de Población y Vivienda se realizará el 16 de noviembre de 2022', 'La ministra de Planificación confirmó la fecha de la encuesta nacional. Se deberá esperar un año para la difusión de los resultados del censo, que contará con el apoyo financiero del Banco Mundial', 'https://eldeber.com.bo/pais/el-censo-de-poblacion-y-vivienda-se-realizara-el-16-de-noviembre-de-2022_240014?utm_medium=Social&utm_source=Facebook#Echo', 17, 2, 16),
(118, 1626927722, 1626825600, 'Habilitan 107 mesas para las elecciones de Comteco este domingo de 8:00 a 16:00', 'El presidente del Tribunal Electoral Departamental, Humberto Valenzuela, entregó los elementos de bioseguridad para la realización de los comicios de este fin de semana, las mesas señaladas están en 28 recintos de votación en 11 municipios que son Cochabamba (Cercado), Sacaba, Quillacollo, Tiquipaya, Colcapirhua, Punata, Cliza, Tarata, Puerto Villarroel, Aiquile y Capinota. El subcomandante departamental de la Policía, Ivan Jose Cordero, dijo que el resguardo policial estará en proceso desde el día sábado con el traslado de las papeletas y el día domingo estarán en presencia del personal encargado hasta que termine la jornada electoral de este domingo.', 'https://www.opinion.com.bo/articulo/cochabamba/elecciones-comteco-serian-domingo-8-00-16-00-votacion-107-mesas/20210721115433828119.html', 13, 1, 39),
(119, 1626928775, 1626825600, 'Lima sobre denuncia de Áñez: “Este ataque nos da la oportunidad de demostrar la verdad de las masacres”', 'El ministro de Justicia Iván Lima responde a la denuncia formal que la expresidenta Jeanine Añez realizó en contra de la autoridad y por ello lo calificó como un ataque, ante ello Lima dijo que la denuncia de la expresidenta no es eficiente la demanda que se presenta e indicó que al momento de admitirse la demanda el Gobierno demostrara la “excepción de la verdad”.', 'https://www.opinion.com.bo/articulo/pais/lima-denuncia-anez-ataque-nos-da-oportunidad-demostrar-verdad-masacres/20210721223237828192.html', 13, 2, 39),
(120, 1626929786, 1626825600, 'Cox: políticos que desinformen sobre tráfico de armas, pueden ser vinculados al caso de Argentina', 'El viceministro de Régimen Interior, Nelson Cox, advirtió que las personas políticas que no informen sobre la denuncia de tráfico ilícito de municiones de Argentina serán vinculados al caso, el canciller Rogelio Mayta junto con Edmundo Novillo, no se dio la contradicción de que los materiales hayan sido utilizados en las masacres tanto de Sacaba como de Senkata, en las cuales fallecieron más de 30 personas, donde hubo intervenciones de fuerzas militares y policiales a marchas de organizaciones afines al MAS, en ese sentido la alianza opositora Comunidad Ciudadana (CC), Carlos Mesa, calificó de Tramoya vergonzosa, a este tipo de denuncias las cuales fueron sustentadas por el Gobierno pero que siguen en investigación como en Bolivia y Argentina.', 'https://www.opinion.com.bo/articulo/pais/cox-politicos-que-desinformen-trafico-armas-pueden-ser-vinculados-caso-armas-argentina/20210721184711828150.h', 13, 2, 39),
(121, 1626930323, 1626825600, 'Del Castillo: Creemos que en un futuro cercano una mujer comandará la Policía', 'El ministro de Gobierno, Eduardo Del Castillo, señaló que en un futuro cercano se espera que una mujer sea Comandante de la Policía Boliviana, hizo esa declaración para defender el proyecto de Ley de Ascensos de la Policía.', 'https://www.opinion.com.bo/articulo/pais/castillo-creemos-que-futuro-cercano-mujer-comandara-policia/20210721115040828117.html', 13, 2, 39),
(122, 1626931625, 1626825600, 'Lío de tierras persiste; interculturales anuncian protestas contra Camacho', 'El secretario ejecutivo de la Federación Sindical de Comunidades Interculturales Productores Agropecuarios de la Gran Chiquitania, Oscar Castro, dio a conocer que procederán a realizar movilizaciones en contra de Luis Fernando Camacho, gobernador de Santa Cruz, a causa que generó confrontaciones entre bolivianos por la dotación de tierras, se rechazó las acusaciones de que el Gobernador cruceño realizó avasallamiento, además se le acusó de confrontar con discursos de regionalismo a los bolivianos por la dotación de tierras, por ello mismo se solicitó al Instituto Nacional de Reforma Agraria (INRA) que proceda a realizar auditorías a aquellas tierras fiscales y tituladas en la Chiquitania. ', 'https://www.opinion.com.bo/articulo/pais/lio-tierras-persiste-interculturales-anuncian-protestas-camacho/20210721004910828101.html', 13, 2, 39),
