(126, 1627008794, 1626912000, 'CIDH presentara informe final este viernes a cancillería de Bolivia', 'E ministro de Juticia Ivan Lima, informo que este viernes se presentara el informe final en relacion los hechos acontoncidos en noviembre del 2019', 'https://www.youtube.com/watch?v=JPwY5pGHCtQ', 32, 2, 43),
(127, 1627008948, 1626912000, 'El TSE instruye a organizaciones políticas adecuar sus estatutos', 'El TSE comunicó que los partidos políticos y agrupaciones ciudadanas con personalidad jurídica vigente deben incorporar en sus estatutos mecanismos para la resolución de denuncias contra el acoso político y la despatriarcalización', 'https://twitter.com/ATBDigital/status/1418341594823077888?s=19', 23, 2, 34),
(128, 1627009322, 1626912000, 'Mesa apunta seis “rupturas democráticas” cometidas por Evo y dice que la Fiscalía debería investigarlo', 'Carlos Mesa, aseveró que el caso “golpe de Estado” es una “tramoya” política y afirmó que el exmandatario Evo Morales cometió al menos seis rupturas democráticas, por lo que el acusado por la Fiscalía debería ser Morales', 'https://www.lostiempos.com/actualidad/pais/20210722/mesa-apunta-seis-rupturas-democraticas-cometidas-evo-dice-que-fiscalia', 12, 2, 44),
(129, 1627009410, 1626912000, 'Comcipo se declara en emergencia y se movilizará en rechazo a la persecución política', 'El Comité Cívico de Potosí (Comcipo) se declaró en estado de emergencia y resolvió movilizarse el 30 de julio en rechazo a las \"intimidaciones\", amenazas y la \"persecución\" política-judicial a cívicos y representantes del magisterio urbano, esto en relación a las protestas que protagonizaron el 2019.', 'https://www.lostiempos.com/actualidad/pais/20210722/comcipo-se-declara-emergencia-se-movilizara-rechazo-persecucion-politica', 12, 2, 44),
(130, 1627009583, 1626912000, 'Asamblea legislativa departamental pide creación de una comisión  mixta para encarar el censo 2022  ', 'La asamblea departamental de Santa Cruz solicita la conformación de una comisión mixta para enfrentar el ceno poblacional 2022  en conjunto del ejecutivo', 'https://www.youtube.com/watch?v=JPwY5pGHCtQ', 32, 2, 43),
(131, 1627009597, 1626912000, 'Gobierno anuncio la realización del censo de población y vivienda para el 16 de noviembre de 2022', '						El Presidente Arce, mediante Decreto Supremo, aprobó la realización del censo de población y vivienda para el 16 de noviembre del año 2022, el argumento planteado es tener una planificación política a través del ordenamiento de datos y cifras; el presupuesto se encuentra garantizado a través del financiamiento externo con asesoramiento del Banco Mundial, para garantizar el trabajo del INE y las regionales. 					', 'https://www.facebook.com/KanchaParlaspa/videos/348621670187812/', 37, 1, 42),
(132, 1627009776, 1626912000, 'Gobierno tomo una buena decisión y ayudaran a gobernaciones ', 'Representante del sector gremial cruceño felicita la decisión del gobierno de encarar el censo 2022 ya que permitirá una mejor distribución de los recursos ', 'https://www.youtube.com/watch?v=JPwY5pGHCtQ', 32, 2, 43),
(133, 1627009821, 1626912000, 'Gobierno tomo una buena decisión y ayudaran a gobernaciones ', 'Representante del sector gremial cruceño felicita la decisión del gobierno de encarar el censo 2022 ya que permitirá una mejor distribución de los recursos ', 'https://www.youtube.com/watch?v=JPwY5pGHCtQ', 32, 2, 43),
(134, 1627010262, 1626912000, 'Gobierno dice que Banco Mundial garantizó el financiamiento del censo 2022', 'La ministra de Planificación del Desarrollo, Gabriela Mendoza, informó este viernes que el Banco Mundial (BM) aseguró su colaboración en el financiamiento para la ejecución del Censo de Población y Vivienda el 16 de noviembre de 2022.', 'https://www.lostiempos.com/actualidad/economia/20210722/gobierno-dice-que-banco-mundial-garantizo-financiamiento-del-censo-2022', 12, 2, 44),
(135, 1627010400, 1626825600, 'Censo de población se realizará el 16 de noviembre de 2022', 'El presidente Luis Arce informó en su cuenta de Twitter este miércoles que el Gabinete de ministros aprobó un decreto que declara prioridad la realización del Censo de Población y Vivienda en noviembre de 2022.', 'https://www.lostiempos.com/actualidad/economia/20210721/censo-poblacion-se-realizara-16-noviembre-2022', 12, 2, 44),
(136, 1627011282, 1626912000, 'Anuncio de bloqueo divide criterios en la ALDO', 'El bloqueo indefinido anunciado en horas precedentes por el Comité Cívico generó repercusión en la Asamblea Legislativa Departamental de Oruro . «El Comité Cívico me parece que recién se está dando cuenta que el Gobierno nacional jamás ha atendido a esta región, un gobierno de la línea de Evo Morales, siempre nos han tratado como un patio trasero de Bolivia si no hay presión el gobierno no nos va atender lamentablemente», aseveró el asambleísta de Un Sol Para Oruro, Román Brito.', 'https://impresa.lapatria.bo/noticia/1040321/anuncio-de-bloqueo-divide-criterios-en-la-aldo#articulo', 15, 2, 17),
(137, 1627011360, 1626912000, 'COD pide proyectos de industrialización para Oruro', 'El ejecutivo de la COD, Elías Colque pidió al Gobierno Central que los proyectos de industrialización especialmente en el área de la minería se reactive ya que Oruro en zona minera.', '', 39, 2, 30),
(138, 1627011883, 1626912000, 'Carlos Mesa pide a la Fiscalía investigar a Evo Morales por los 6 delitos cometidos ', 'En un artículo de Carlos Mesa, titulado Evo Morales y su desprecio por la constitución y la democracia,es donde detalla los hechos del año 2019, donde también ratificó que el caso por el supuesto “golpe de Estado” es una tramoya política, habla de los delitos del no reconocimiento del referéndum del año 2016, el fraude de las elecciones 2019 y plan de dejar sin un gobierno al país.', '', 35, 2, 18),
(139, 1627012005, 1626912000, 'Enfrentamiento para la de la renuncia de la Defensora del Pueblo ', 'Mediante una carta abierta el Conade le exige a la defensora del pueblo interina Nadia Cruz, su renuncia ya que afirman que existe silencio y complicidad ante un evidente abuso de poder y una vulneración de los derechos constitucionales del líder de la resistencia juvenil cochala Mario Bascope.  El presidente del conade Manuel Morales sostiene que es una violscionde los derechos humanos ', '', 35, 2, 18),
(140, 1627012478, 1626912000, 'Asamblea Legislativa eligira nuevos vocales electorales.', 'Tras la suspensión de cuatro vocales en el departamento del Beni, el asambleísta Marcelo Vargas dijo que se procederá a convocar a los nuevos asambleístas y que será un proceso transparente, normativo.', '', 35, 2, 18),
(141, 1627013371, 1626912000, '43% de la población vacunada en Pando ', 'La ciudadanía tiene mal información sobre las vacunas y más aún en el Área rural ', 'Canal 15 SPC ', 27, 2, 20),
(142, 1627013640, 1626912000, 'Transparencia dice que aumentan denuncias contra Exintendente Vargas', 'El director de Transparencia y Lucha contra la Corrupción, Davy Ureña dijo que se registraron otras cinco denuncias que van en contra del ex intendente Fernado Vargas, que ahora involucra a su pareja, Lorena Zeballos, pero la Dirección de Transparencia y Lucha Contra la Corrupción está abierta para Fernando Vargas y para toda la población general debido a que en sus redes sociales se denuncian actos de corrupción al interior del municipio. ', 'https://www.opinion.com.bo/articulo/cochabamba/transparencia-informa-que/20210722165751828281.html', 13, 2, 39),
(143, 1627014026, 1626912000, 'Ex Comandante Inchauste declara en el Colegio de Abogados', 'El excomandante fue trasladado al colegio de abogados para brindar su declaración, es acusado por homicidio. Fue aprendido por los hechos de senkata de 2019', '', 24, 2, 29),
(144, 1627014205, 1626912000, 'Grupo interdisciplinarios de expertos de la CIDH presentará informe final al gobierno', 'Se presentará este viernes el informe oficialmente a la Cancillería, el informe trata sobre la investigación de los hechos de Senkata y Sacaba, las autoridades analizaran y presentarán el informe en un lapso de 10 días, no es una sentencia solo un informe consultivo, por eso en algunas partes es vinculante y en otras tiene carácter de recomendación.', '', 24, 2, 29),
(145, 1627014372, 1626912000, 'Ivan Lima señala que si Jeanine Añez presenta una demanda en su contra, entonces citará un recurso de excepción', 'El ministro Lima no sabe oficialmente si será demandado, pero en caso de entonces presentará un recurso de excepción de verdad con lo que busca demostrar la responsabilidad de la exmandataria por las muertes de Senkata y Sacaba.', '', 24, 2, 29),
(146, 1627014623, 1626912000, 'El GIEI entregará su informe de hechos de 2019 y estiman que en agosto será de conocimiento público', 'El Grupo Interdisciplinario de Expertos Independientes (GIEI) presentará este viernes un informe final explicando los hechos ocurridos en Bolivia entre los mese de septiembre y diciembre del año 2019 y existe la probabilidad de que se pueda hacer público el documento, por ello el Ministro de Justicia y Transparencia, Ivan Lima, confirmó que la documentación ser entregada este 23 de julio ante la Cancillería, en el informe que se emita por el GIEI no es equivalente a una sentencia ni tampoco a una opinión consultiva, sino a las preguntas de violaciones a los Derechos Humanos que habría ocurrido el 1 de septiembre al 31 de Diciembre del año 2019, durante aquellos meses de violencia, en Senkata, El Alto, se perdieron unas 10 vidas por impacto de bala, por otro lado en Sacaba, Cochabamba, fallecieron 10 personas en pleno operativo de la Policía y las Fuerzas Armadas para contener las protestas del partido político MAS. ', 'https://www.opinion.com.bo/articulo/pais/giei-entregara-informe-hechos-2019-estiman-que-agosto-sera-conocimiento-publico/20210722181030828286.html', 13, 2, 39),
(147, 1627015132, 1626912000, 'COMCIPO se declara en emergencia y se moviliza en rechazo a la persecución política', 'COMCIPO resolvió movilizarse el 30 de julio próximo, en rechazo a la intimidación, amenazas y persecución político-judicial a Cívicos y representantes del Magisterio Urbano, en relación a las protestas realizadas el año 2019, emplazándoles a dar información sobre quienes formaron parte del directorio, que instituciones estuvieron en la lucha y las características de como formaron el comité de movilizaciones ese año.', 'https://www.facebook.com/KanchaParlaspa/videos/348621670187812/', 37, 2, 42),
(148, 1627015586, 1626912000, 'Arce destaca que las mujeres son pilar fundamental del proceso de cambio', 'El presidente del Estado Plurinacional, Luis Arce Catacora, dijo que las mujeres bolivianas son baluarte y pilar fundamental del proceso de cambio, donde participó del primer ampliado nacional de la Confederación Nacional de Mujeres Campesinas Indígenas Originarias de Bolivia (CNMCIOB) Bartolina Sisa, donde se realizó en el departamento de Potosí en la localidad de Betanzos, en el cual el mandatario felicitó a las mujeres por ser partícipes de este gran encuentro y así también agradeció a las organizaciones sociales debido a la recuperación de la democracia. ', 'https://www.opinion.com.bo/articulo/pais/arce-destaca-que-mujeres-son-pilar-fundamental-proceso-cambio/20210722155215828275.html', 13, 2, 39),
(149, 1627016285, 1626912000, 'FELCC aprehende y traslada a La Paz a general del Ejército por el caso Senkata', 'La Fuerza Especial de Lucha Contra el Crimen (FELCC) de Cochabamba aprehendió hoy por la mañana al general del Ejército, Iván Patricio Inchauste Rioja, por el marco de las investigaciones que está realizando el Ministerio Público debido a las muertes de Senkata en el año 2019, a estos 20 meses del conflicto suman 10 exjefes militares que están siendo procesados por las muertes de Sacaba (Cochabamba) y Senkata (El Alto), dentro estos 8 están con detención domiciliaria y preventiva y 2 de ellos tienen orden de captura, por ello el director de la FELCC, Rolando Rojas, informó que Inchauste ya fue llevado a La Paz donde se llevará a cabo la audiencia de medidas cautelares, por el que se acusa de homicidio y lesiones graves y leves. ', 'https://www.opinion.com.bo/articulo/pais/felcc-aprehende-traslada-paz-coronel-ejercito-caso-senkata/20210722153155828273.html', 13, 2, 39),
(150, 1627017019, 1626912000, 'Áñez presenta denuncia contra Lima por difamación y calumnia', 'La expresidenta Jeanine Añez detenida en la cárcel de Miraflores, formalizó una denuncia en contra del Ministro de Justicia y Transparencia, Ivan Lima, por supuestas calumnias en su contra y por difamación, en respuesta a la denuncia Lima, a través de un comunicado, informó que es deficiente la procedencia de la denuncia y que se demostrara que Añez si es autora del fallecimiento de más de 22 personas en el conflicto del año 2019.  ', 'https://www.opinion.com.bo/articulo/pais/anez-presenta-denuncia-lima-difamacion-calumnia/20210722012554828249.html', 13, 2, 39),
(151, 1627017694, 1626912000, 'Gobierno advierte con vincular al caso armas a quienes desinformen', 'La autoridad del viceministro de Régimen Interior, dependiente del Ministerio de Gobierno, Nelson Cox, informo que aquellos actores políticos que no informen a la población sobre el tráfico ilícito de armas podrían ser vinculados al caso por otra parte solicitó que los asambleístas de Comunidad Ciudadana (CC) deben ser más responsables con las declaraciones que brindan a la población con aquellas afirmaciones que prometen impunidad. ', 'https://www.opinion.com.bo/articulo/pais/gobierno-advierte-vincular-caso-armas-quienes-desinformen/20210722011100828242.html', 13, 2, 39),
(152, 1627046492, 1626912000, 'Mineros exigen pronunciamiento de sus recursos', ' Sindicatos de mineros y fabriles muestran su rechazo a la falta de respeto por parte del tribunal constitucional plurinacional, a falta de notificación con respecto a sus recursos', 'https://www.facebook.com/TvSucreUSFX/videos/812127446332980', 20, 2, 54),
(153, 1627054958, 1627516800, 'La derrota de keiko fujimori y reconoce al presidente electo proclamado del perú pedro castillo', '						Tras la derrota de keiko fujimori en la segunda vuelta electoral en el pais del peru pasado el 6 de junio pedro castillo es el actual ganador en las elecciones presidenciales 					', '', 47, 2, 22),
(154, 1627055036, 1627084800, 'Aprueban juicio para el alcalde electo de cochabamba manfred reyes villa ', '						La Comisión Mixta de Justicia Plural de la Asamblea Legislativa aprobó ayer otros tres informes de juicios de responsabilidades para exautoridades de 2007 y 2008. En la lista figuran Leonilda Zurita, Arturo Murillo, el actual alcalde de Cochabamba Manfred Reyes Villa y otros.\r\nEn el primer caso, señala dentro del proceso a Reyes Villa como exprefecto, Murillo (exdiputado), Zurita (exsenadora) y Omar Fernández también como exsenador.\r\nSe los acusa por los delitos de incumplimiento de deberes, denegación de auxilio, sedición, incendio, destrucción o deterioro de bienes del Estado y la riqueza nacional, resoluciones contrarias a la Constitución y las leyes, instigación pública a delinquir, atentado contra la seguridad de los transportes, uso indebido de influencias y malversación.																			', 'https://grupocentro.com.bo/noticias/Local', 47, 2, 22),
(155, 1627056468, 1626912000, 'Gobierno anuncio este miercoles  que el banco Mundial garantizó el financiamiento del censo 2022', 'La ministra de Planificación del Desarrollo, Gabriela Mendoza, informó este viernes que el Banco Mundial (BM) aseguró su colaboración en el financiamiento para la ejecución del Censo de Población y Vivienda el 16 de noviembre de 2022. que gestiono el banco mundial ', '', 47, 1, 22),
(156, 1627080654, 1626998400, 'Se entregara bono estudiantil en el Alto.', 'Bono estudiantil reemplazara el desayuno escolar, se estima BS 300 en efectivo por cada estudiante, afirma la alcaldesa Eva Copa.', 'https://www.redbolivision.tv.bo/video/noticieros-al-dia-programa-del-23-de-julio-del-2021/', 22, 2, 31),
(157, 1627082163, 1626912000, 'Vocal Baptista del TSE afirma que una auditoria al padrón es necesaria ', '						QUÉ / QUIÉN / POR QUÉ 					', 'https://correodelsur.com/politica/20210723_jubileo-censo-de-2022-permitira-al-pais-saber-donde-y-como-estamos.html', 14, 1, 51),
(158, 1627093158, 1626998400, 'Procurador sobre informe del GIEI: Ojalá haya un punto sobre los medios que mintieron al país.', 'El procurador general del Estado, Wilfredo Chávez, afirmó este viernes que el informe del Grupo Interdisciplinario de Expertos Independientes (GIEI) debería tener un punto relacionado a los medios de comunicación y sus actores, por “mentir al país”. El exministro y exabogado de Evo Morales señaló que los medios de comunicación “tergiversan” las cosas cuando “se les dice la verdad”.', 'https://www.paginasiete.bo/nacional/2021/7/23/procurador-sobre-informe-del-giei-ojala-haya-un-punto-sobre-los-medios-que-mintieron-al-pais-301851.html', 14, 2, 34),
(159, 1627093447, 1626998400, 'Justicia ordena la detención preventiva del general Inchauste en San Pedro.', 'La jueza primero cautelar de El Alto, Milenka Gutiérrez, dispuso esta tarde la detención preventiva en el penal de San Pedro de La Paz del excomandante del Ejército, general Iván Inchauste, imputado por los delitos de homicidio y lesiones graves y leves por el caso Senkata.  Inchauste, quien deberá permanecer encarcelado seis meses,  fue comandante accidental del Ejército durante el Gobierno transitorio de Jeanine Añez. Fue posesionado el 13 de noviembre por la mandataria de entonces junto a otros miembros del Alto Mando Militar. Sin embargo, en marzo de 2020 fue sustituido por Rubén Salvatierra Fuentes, presuntamente por haber mantenido contactos con el expresidente Evo Morales, acusación que rechazó.', 'https://www.paginasiete.bo/seguridad/2021/7/23/justicia-ordena-la-detencion-preventiva-del-general-inchauste-en-san-pedro-301883.html?__twitter_impres', 14, 2, 34),
(160, 1627093949, 1626998400, 'Exjefe de Seguridad de Murillo, imputado por caso falsificación de condecoraciones.', 'En septiembre del año pasado, el Departamento de Análisis Criminal e Inteligencia (DACI) realizó un operativo en el que encontraron condecoración falsas en posesión de uniformados que iban a ser utilizados para obtener mejores calificaciones para los ascensos de policías. Entre ellos figuraba el nombre del actual comandante de la Policía, Jhonny Aguilera. Ciro Ortega, exjefe de Seguridad del exministro Arturo Murillo, fue imputado por los delitos de incumplimiento de deberes y uso indebido de influencias por el caso de falsificación de al menos 40 condecoraciones de la Policía Nacional, informó hoy el coordinador de la Fiscalía Departamental de La Paz, Sergio Bustillos. ', 'https://www.paginasiete.bo/seguridad/2021/7/23/exjefe-de-seguridad-de-murillo-imputado-por-caso-falsificacion-de-condecoraciones-301881.html?__twitter', 14, 2, 34),
(161, 1627095866, 1626998400, 'Patty pide ALP realizar interpelación al fiscal', 'la ex asambleísta por el Movimiento a socialismo pide procesar al ex fiscal general por el caso golpe de estado', 'https://www.youtube.com/watch?v=_lirbxJsanQ', 32, 2, 43),
(162, 1627096012, 1626998400, 'Movilización permitió el retorno de la democracia en Bolivia ', 'Las movilización de los movimientos sociales, permitieron el retorno a la democracia mediante las elecciones realizadas el 2020', 'https://www.youtube.com/watch?v=_lirbxJsanQ', 32, 2, 43),
(163, 1627096641, 1626998400, 'Aprehenden a ex-comandante del ejército por el caso Senkata.', 'Ivan Inchauste, que fuera comandante del ejército durante el gobierno transitorio de Jeanine Añez, fue aprehendido en Cochabamba y trasladado a La Paz; actualmente espera la concreción de su audiencia cautelar en celdas de la FELCC.', '', 43, 2, 46),
(164, 1627097242, 1626998400, 'Parlamentario de Creemos cuestiona, la dilación que induce el gobierno, a la publicación del informe sobre DD.HH. de la CIDH para el caso de Sacaba y Senkata.', '												Erwin Bazan, diputado de Creemos por Santa Cruz, señala que el informe sobre DD.HH. de la CIDH es retrasado por el gobierno, quien ya habría anunciado 2 fechas para su publicación, incumpliendo con ambas fechas dispuestas; y condicionando una tercera fecha tentativa, a la previa revisión del informe, por parte del gobierno.										', '', 43, 2, 46),
(165, 1627101485, 1626998400, 'Alcaldesa de Cobija se refiere a la importancia del nuevo censo', 'Para la Alcaldesa de Cobija, el nuevo censo será muy importante porque ayudará a generar empleo, realizar proyectos de alcantarillado y agua potable, así como mejorar la educación y la salud con la construcción de hospitales, ya que ese municipio esta trabajando con recursos del 2008, porque en el ultimo censo Cobija tenía 48.000 habitantes, cuando en realidad cuenta con mas de 100.000 habitantes.', 'https://www.facebook.com/KanchaParlaspa/videos/1001484654031186', 37, 1, 42),
(166, 1627101921, 1626998400, 'Aprehensión es Inchauste es Ilegal', 'Rene Villarroel, abogado de Inchauste, indica que no es parte del proceso y es inocente, por lo que presentaron una acción de libertad por aprehensión ilegal. Inchauste se acogió al silencio, Villarroel indica que apoyará con la investigación de los hechos para todo se esclaresca. Fue imputado por homicidio, lesiones graves y leves, la fiscalía pide la detención preventiva, es investigado por las muertes de Senkata en noviembre. ', '', 24, 2, 29),
(167, 1627102047, 1626998400, 'Detención preventiva para Inchauste', 'Concluyó la audiencia de medidas cautelares virtual del ex general Inchauste, su abogado Villarroel indica que se determinó la detención preventiva pese a que se indicó que los riesgos procesales no calificaban porque la documentación no fue valorada por el juez, la acción de libertad también fue negada. Entre hoy o mañana se lo trasladará a San Pedro, los delitos son el supuesto homicidio y lesiones graves ', '', 24, 2, 29),
(168, 1627102151, 1626998400, 'Declara Ex jefe del Estado MayoR', 'Pablo Guerra terminó su delcaración en el Colegio de Abogados, será trasladado a las celdas de la FELCC, mañana (sábado) será la audiencia para determinar medidas cautelares', '', 24, 2, 29),
(169, 1627102241, 1626998400, 'Inchauste se acogió al silencio', 'El coronel Alberto Aguilar indica que se continúa con los trabajos de investigación, no encontraron al ex comandante de la armada boliviana, el contra almirando Orlando Mejía, localizaron su domicilio en la zona sur pero dieron con él. Mejía es investigado también por lesiones graves y leves, homicidio supestamente cometidos en los hechos de noviembre 2019. ', '', 24, 2, 29),
(170, 1627102428, 1626998400, 'Ex jefe del Estado Mayor fue trasladado a la FELCC, es procesado por las muertes en Senkata', 'La declaración informativa duró más de 4 horas, el ex general Guerra fue trasladado a la FELCC donde pasará la noche y mañana será la audiencia de medidas cautelares, es acusado por homicidio y lesiones graves y gravísimas', '', 24, 2, 29),
(171, 1627102788, 1626998400, 'La Fiscalía aprehende al exjefe de Estado Mayor de las FFAA por el caso Senkata', 'El exjefe de Estado Mayor General de las Fuerzas Armadas Pablo Arturo Guerra Camacho fue detenido este viernes en la ciudad de La Paz. Tras ser llevado a su audiencia fiscal, fue aprehendido', 'https://www.la-razon.com/nacional/2021/07/23/la-fiscalia-aprehende-al-exjefe-de-estado-mayor-de-las-ffaa-por-el-caso-senkata/', 53, 2, 29),
(172, 1627103001, 1626998400, 'Mando policial de 2019 reunió a los agregados policiales y pidió agentes químicos', 'El exagregado de la Gendarmería argentina en Bolivia Héctor Adolfo Caliba informó de la convocatoria y reunión al comandante de la Gendarmería Gerardo José Otero.', 'https://www.la-razon.com/nacional/2021/07/23/mando-policial-de-2019-reunio-a-los-agregados-policiales-y-pidio-agentes-quimicos/				k			 							', 53, 2, 29),
(173, 1627103126, 1626998400, 'Envían a la cárcel al excomandante del Ejército Inchauste por el caso Senkata', 'El excomandante del Ejército Iván Patricio Inchauste Rioja fue enviado con detención preventiva por seis meses a la cárcel de San Pedro. Cuatro militares están procesados por este caso', 'https://www.la-razon.com/nacional/2021/07/23/envian-a-la-carcel-al-excomandante-del-ejercito-inchauste-por-el-caso-senkata/', 53, 2, 29),
(174, 1627103686, 1626998400, 'Camacho niega trámite de asilo y revela que ‘hubo embajadas que le ofrecieron asilo’ en 2019', 'El excívico y gobernador cruceño Luis Fernando Camacho confirmó que, efectivamente, tuvo una reunión con los cónsules de Argentina y España, quienes pidieron garantías para poder salir de Bolivia', 'https://www.la-razon.com/nacional/2021/07/23/camacho-niega-tramite-de-asilo-y-revela-que-hubo-embajadas-que-le-ofrecieron-asilo-en-2019/', 53, 2, 29),
(175, 1627103792, 1626998400, 'Exjefe del Estado Mayor de las FFAA es detenido por los hechos registrados en Senkata', 'Pablo Arturo Guerra Camacho fue detenido en su domicilio por la DACI en cumplimiento a una orden del Ministerio Público. Con el General de División Aérea ya son cuatro los militares procesados en este caso.', 'https://www.la-razon.com/nacional/2021/07/23/exjefe-del-estado-mayor-de-las-ffaa-es-detenido-por-los-hechos-registrados-en-senkata/', 53, 2, 29),
(176, 1627103935, 1626998400, 'Arce dice que cada día se ratifica que el ‘golpe’ tuvo participación de toda la derecha del continente', '“La derecha no duerme, la derecha está ahí al frente y todos sabemos que tenemos un enemigo común ahí al frente”, expresó el Jefe del Estado. Indicando que día que pasa se ratifica el golpe del 2019 en la cual participó toda la derecha del continente', 'https://www.la-razon.com/nacional/2021/07/23/arce-dice-que-cada-dia-se-ratifica-que-el-golpe-tuvo-participacion-de-toda-la-derecha-del-continente/', 53, 2, 29),
(177, 1627137915, 1626998400, 'TSE asume administración del TED de Beni', 'El Tribunal Supremo Electoral (TSE) asumió \"administrativamente\" funciones en el Tribunal Electoral Departamental (TED) de Beni, después que esta entidad quedó descabezada producto de un amparo constitucional que anuló todo el proceso de selección de vocales electorales de diciembre de 2019 y cuatro vocales quedaron cesados de sus funciones.', 'https://www.lostiempos.com/actualidad/pais/20210723/tse-asume-administracion-del-ted-beni', 12, 1, 44),
(178, 1627138282, 1626998400, 'Relator de ONU ve \"preocupante\" y \"grave\" la remoción de vocales electorales en Bolivia', 'El Relator Especial de la ONU, Diego García, se pronunció este viernes después de que el presidente Luis Arce, por decretos, cesó en el cargo a vocales electorales departamentales elegidos por Jeanine Áñez. Consideró que se trata de una situación “muy grave para el Estado de Derecho”.', 'https://www.lostiempos.com/actualidad/pais/20210723/relator-onu-ve-preocupante-grave-remocion-vocales-electorales-bolivia', 12, 1, 44),
(179, 1627140844, 1627084800, 'Censo Prueba de insercion', 'Resumen de la prueba de insercion', 'https://censo-noticia', 24, 3, 5),
(180, 1627179212, 1626825600, 'Gobierno aprueba decreto y anuncia Censo para el 16 de noviembre de 2022', 'El gobierno, mediante un Decreto Supremo, anuncia que se realizará el Censo de Población y Vivienda para el 16 de noviembre de 2022, esta información fue proporcionada por la ministra de Planificación del Desarrollo, Gabriela Mendoza, quien dijo que lo primordial es llevar adelante el Censo del próximo año, que se llevará a cabo por el Instituto Nacional de Estadística (INE).', 'https://www.opinion.com.bo/articulo/pais/gobierno-aprueba-decreto-anuncia-censo-16-noviembre-2022/20210721113834828116.html', 13, 3, 39),
(181, 1627179697, 1626912000, 'Arias pide a la población quedarse en el municipio de La Paz para no afectar el Censo', 'El alcalde de La Paz Ivan Arias pidió este jueves a la población alteña quedarse en el lugar de residencia y no cambiar de municipio como también no viajar a otras comunidades esto con el fin de no afectar al Censo de Población y Vivienda, que se previsto el 16 de noviembre de 2022, por otro lado también pidió que se reflexione sobre donde reciben servicios de salud, transporte y educación. ', 'https://www.opinion.com.bo/articulo/pais/arias-pide-poblacion-quedarse-municipio-paz-afectar-censo/20210722210139828300.html', 13, 3, 39),
(182, 1627180052, 1626912000, 'BM asegura financiamiento para la realización del Censo de Población y Vivienda 2022', 'La ministra de Planificación del Desarrollo,Gabriela Mendoza, Informó este viernes que el Banco Mundial (BM) colaborará con el financiamiento para la ejecución del Censo de Población y Vivienda, en ello aclaró la autoridad que el gobierno nacional asumirá la totalidad del costo de la realización del Censo de Población y Vivienda, en los nueve departamentos. ', 'https://www.opinion.com.bo/articulo/pais/bm-asegura-financiamiento-realizacion-censo-poblacion-vivienda-2022/20210722121439828268.html', 13, 3, 39),
(183, 1627182160, 1626998400, 'Justicia admite amparo contra vocales del TED sobre elecciones en Comteco', '						La citación a los vocales del TED fue emitida por la presidenta de la Sala Constitucional Cuarta del Tribunal Departamental de Justicia de La Paz, Carmina Vera, en el marco de las elecciones de renovación de consejeros en el Comite de Administracion y Vigilancia en La Cooperativa de Telecomunicaciones Cochabamba, Comteco R.L. Los vocales del Tribunal Electoral Departamental (TED),  Humberto Valenzuela, Tito Rodríguez, Sixto Fuentes y Ruth Montejo, son los que la justicia admite tienen amparo. \r\n					', 'https://www.opinion.com.bo/articulo/cochabamba/justicia-admite-amparo-vocales-ted-elecciones-comteco/20210723130501828389.html', 13, 1, 39),
(184, 1627182712, 1626998400, 'Alcaldía anuncia seguimiento a 300 procesos penales pendientes, uno contra Edwin Castellanos', 'En la gestión actual municipal de Cochabamba, al mando del alcalde Manfred Reyes Villa, se confirmó que se hace seguimiento a 300 procesos penales que las anteriores autoridades habían dejado pendientes uno de ellos es en contra del exalcalde Edwin Castellanos, en ese sentido el secretario de Asuntos Jurídicos de la Alcaldía de Cochabamba, Orlando Vargas, explicó en Buena Noche de Opinión que hay una retardación de justicia en la mayoría de los casos. ', 'https://www.opinion.com.bo/articulo/cochabamba/alcaldia-anuncia-seguimiento-300-procesos-penales-pendientes-edwin-castellanos/20210723213714828432.htm', 13, 2, 39),
(185, 1627207578, 1627084800, 'Organizaciones del MAS apuntan a dos ministros de Arce', 'Los campesinos observan la gestiones de los ministros de Justicia y de Gobierno, además del accionar del fiscal general.', 'https://eldeber.com.bo/pais/organizaciones-del-mas-apuntan-a-dos-ministros-de-arce_240462?utm_medium=Social&utm_source=Facebook#Echobox=1627182877', 17, 2, 16),
(186, 1627207826, 1627084800, 'Exasesor de Murillo es enviado a San Pedro por tráfico de certificados en la Policía', 'El juzgado Primero Cautelar de la zona Sur de la ciudad de La Paz, dictó seis meses de cárcel para Ciro Ortega Sequeiros, exasesor de Arturo Murillo que está involucrado en el caso de la venta de certificados a oficiales de alto rango de la Policía.    Uso indebido de influencias e incumplimiento de deberes.', 'https://eldeber.com.bo/pais/exasesor-de-murillo-es-enviado-a-san-pedro-por-trafico-de-certificados-en-la-policia_240452?utm_term=Autofeed&utm_medium=S', 17, 2, 16);
